import React from 'react';

import { action } from '@storybook/addon-actions';

import TextField from './styled-input';

export default {
    title: 'Styled Inout',
};

export const Default = () => (
    <div>
    <TextField
        autoComplete="none"
        autoFocus={true}
        placeholder={this.props.i18n.page.login.user}
        inputProps={{autoCapitalize: "none"}}
        fullWidth={true}
        value={this.props.user.username}
        onChange={event => UserActions.setUsername(event.target.value)}
        disabled={this.props.ui.loggingIn}
        onBlur={this.onInputBlur}
        id="username"
    />
    <TextField
type="password"
autoComplete="none"
placeholder={this.props.i18n.page.login.password}
inputProps={{autoCapitalize: "none"}}
fullWidth={true}
value={this.props.user.password}
onChange={event => UserActions.setPassword(event.target.value)}
disabled={this.props.ui.loggingIn}
onBlur={this.onInputBlur}
id="password"
    />
    </div>
);
